import React from "react";
import { Link, Outlet } from "react-router-dom";

export default function App() {
  return (
    <div>
      <nav style={{ display: "flex", gap: "1rem", padding: "1rem", background: "#f5f5f5" }}>
        <Link to="/">Home</Link>
        <Link to="/analytics">Analytics</Link>
      </nav>
      <Outlet />
    </div>
  );
}
